import React from 'react';
import ReactDOM from 'react-dom';
import "./index.css"
const name = "meraj";
const img1 = "https://picsum.photos/200/300";
const img2 = "https://picsum.photos/200/310";
const img3 = "https://picsum.photos/230/300";
ReactDOM.render(
    <>
      <h1 class="heading">{`My name is ${name}`}</h1>
      <img class="image" src ={img1} alt="random images"></img>
      <img class="image" src ={img2} alt="random images"></img>
      <img class="image" src ={img3} alt="random images"></img>
    </>,
   document.getElementById('root')
);
